import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      {/* Fiverr Logo */}
      <Link to="/" className="logo">fiverr<span className="dot">.</span></Link>

      {/* Main Links */}
      <div className="nav-links">
        <span className="nav-item">Fiverr Pro ‚ñæ</span>
        <span className="nav-item">Explore ‚ñæ</span>
        <span className="nav-item">üåê EN</span>
        <span className="nav-item">Become a Seller</span>
        <span className="nav-item blue">Fiverr Go</span>
        <Link to="/login" className="nav-item">Sign In</Link>
      </div>

      {/* Join Button */}
      <Link to="/register-client">
        <button className="join-btn">Join</button>
      </Link>
    </nav>
  );
}

export default Navbar;
